  constructor(props) {
    super(props);
    this.state = { 
        name: 'Tasks!'
    };
  }

  render() {
    return (
        <React.Fragment>
            <h1>{this.state.name}</h1>
            <TasksEditor />
        </React.Fragment>
    );
  }
}

export default Tasks;
